import React, { useState } from 'react';
import { Container, TextField, Button, Typography, Box, Grid, Paper } from '@mui/material';
import RuleForm from './components/RuleForm';
import CombineRules from './components/CombineRules';
import EvaluateRules from './components/EvaluateRules';

function App() {
  const [rules, setRules] = useState([]);
  const [combinedAST, setCombinedAST] = useState(null);
  const [evaluationResult, setEvaluationResult] = useState(null);
  const [error, setError] = useState(null);
  const [inputData, setInputData] = useState({
    age: '',
    department: '',
    salary: '',
    experience: '',
  });

  const addRule = (rule) => {
    setRules([...rules, rule]);
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setInputData({
      ...inputData,
      [name]: value,
    });
  };

  return (
    <Container>
      <Typography variant="h3" align="center" gutterBottom>
        Rule Engine
      </Typography>
      <Box my={4}>
        <Paper elevation={3} style={{ padding: '20px' }}>
          <RuleForm onAddRule={addRule} />
        </Paper>
      </Box>
      <Box my={4}>
        <Paper elevation={3} style={{ padding: '20px' }}>
          <CombineRules rules={rules} setCombinedAST={setCombinedAST} setError={setError} />
        </Paper>
      </Box>
      <Box my={4}>
        <Paper elevation={3} style={{ padding: '20px' }}>
          {combinedAST && (
            <>
              <EvaluateRules
                combinedAST={combinedAST}
                inputData={inputData}
                setEvaluationResult={setEvaluationResult}
                setError={setError}
              />
              <Box my={2}>
                <Typography variant="h5">Evaluation Result:</Typography>
                <Typography variant="body1">{evaluationResult !== null ? (evaluationResult ? 'True' : 'False') : 'No result yet'}</Typography>
              </Box>
            </>
          )}
          <div>
            <Typography variant="h5" gutterBottom>Input Data</Typography>
            <form>
              <Grid container spacing={2}>
                <Grid item xs={6} md={3}>
                  <TextField
                    fullWidth
                    label="Age"
                    type="number"
                    name="age"
                    value={inputData.age}
                    onChange={handleInputChange}
                  />
                </Grid>
                <Grid item xs={6} md={3}>
                  <TextField
                    fullWidth
                    label="Department"
                    name="department"
                    value={inputData.department}
                    onChange={handleInputChange}
                  />
                </Grid>
                <Grid item xs={6} md={3}>
                  <TextField
                    fullWidth
                    label="Salary"
                    type="number"
                    name="salary"
                    value={inputData.salary}
                    onChange={handleInputChange}
                  />
                </Grid>
                <Grid item xs={6} md={3}>
                  <TextField
                    fullWidth
                    label="Experience"
                    type="number"
                    name="experience"
                    value={inputData.experience}
                    onChange={handleInputChange}
                  />
                </Grid>
              </Grid>
            </form>
          </div>
        </Paper>
      </Box>
      {error && <Typography color="error">{error}</Typography>}
    </Container>
  );
}

export default App;
